import React, { Component } from "react";

class MeuNome extends Component {
  render () {
    return (
      <div>
        <h1>Maria Isabella</h1>
        <p>Tenho 29 anos, sou casada e tenho duas filhas, meus maiores tesouros!</p>
      </div>
    )
  }
}

export default MeuNome;
